import React from 'react'

const ProductCard = () => {
  return (
    <div>
      <img src="https://lp2.hm.com/hmgoepprod?set=quality%255B79%255D%252Csource%255B%252F87%252F12%252F871296ac0e9a4891f48727a8960875b7760cb776.jpg%255D%252Corigin%255Bdam%255D%252Ccategory%255B%255D%252Ctype%255BLOOKBOOK%255D%252Cres%255Bm%255D%252Chmver%255B1%255D&call=url%5Bfile:/product/main%5D"/>
      <div>Conscious choice</div>
      <div>벨티드 트윌 코드</div>
      <div>99000</div>
      <div>신제품</div>
    </div>
  )
}

export default ProductCard
